import React, { useContext, useEffect, useState } from "react";
import 'bootstrap/dist/css/bootstrap.css';
import { BsPlusSquare } from "react-icons/bs";
import { useNavigate } from "react-router-dom";
import { auth } from "./firebase";
import './home.css';
import { onAuthStateChanged  } from "firebase/auth";
import { Appcontext } from "./Navi";

function Navbar() {
    const navigate = useNavigate();
    
    const [userimg,setimage] = useState({});
    // onAuthStateChanged(auth,(current)=>{setimage(current)});//when i try to put userauth not why?
    useEffect(()=>{
        const {userauth} = useContext(Appcontext);
        setimage(userauth);

    },[])
    const handleaddpost = () => {
        navigate('/Addpost');
    }
    return ( 
        <div>
            <nav className="navbar navbar-expand-lg navbar-dark bg-primary">
            <div className="container">
            <a href="/" className="navbar-brand fw-bolder" >instagram</a>
            <button className="navbar-toggler" type="button" data-toggle="collapse"  data-target ="#mynavbar"
            aria-controls="mynavbar" aria-label="Toggle navigation" aria-expanded="false">
                <span className="navbar-toggler-icon"></span>
            </button>
            <div className="collapse navbar-collapse " id="mynavbar"> 
            <ul className="navbar-nav ms-auto">
                <li className="nav-item"><a href="/home" className="nav-link">Home</a></li>
                <li className="nav-item"><a href="/addpost" className="nav-link"> Post  (<BsPlusSquare size={18} onClick={handleaddpost}></BsPlusSquare>)
                </a></li>
                <li className="nav-item">{  userauth ==="" && <button type="submit" className="btn2" onClick={()=>{navigate( "/" )}}>Login</button> 
            }</li>
             <li className="nav-item">{  userauth ==="" && <button type="submit" className="btn2" onClick={()=>{navigate( "/createuser" )}}>signup</button> 
             }</li>
             <li>{userimg.displayName}</li>
            </ul>
            </div>
            </div>
            </nav>
            {  userimg && <img className="logo" src={userimg?.photoURL} alt="user" ></img>}
        </div>
     );
}

export default Navbar;
